export class BenchmarkTestStep{constructor(t,e){this.name=t,this.run=e}}export class BenchmarkTestSuite{constructor(t,e){this.name=t,this.tests=e}async run(){for(const t of this.tests)await t.run();return"done"}}export function runWorkloadTest(t){return new Promise((e=>{t(),setTimeout((()=>e({type:"workload-test-complete"})),0)}))}export function sleep(t){return new Promise((e=>setTimeout((()=>e()),t)))}